function Card({ title, content, link}) {
    return (
        <div>
            <a href={link} target="_blank" rel="noopener noreferrer" className="card-link">
                <h3>{title}</h3>
            </a>
            <p>{content}</p>
        </div>
    );
}


function MiniCard({ title, content, link, backgroundColor, padding, borderRadius}) {
    return (
        <div style={{backgroundColor, padding, borderRadius}}>
            <a href={link} target="_blank" rel="noopener noreferrer" className="color-of-minicard">
                <h3>{title}</h3>
            </a>
            <p>{content}</p>
        </div>
    );
}

function Board({ title, content}) {
    return (
        <div>
            <h3>{title}</h3>
            <p>{content}</p>
        </div>
    )
}

export { MiniCard, Board };
export default Card;
